import img1 from '../img/products_page/laptop3.jpeg'
import img2 from '../img/products_page/laptop5.jpeg'

const testData = {
    productData: [
        {
            id: 1,
            img: img1,
            title: 'GIGA CHAD LAPTOP',
            price: '6969.69',
            quantity: '69',
        },
        {
            id: 2,
            img: img2,
            title: 'POOPOO LAPTOP',
            price: '707.99',
            quantity: '420',
        }
    ]
}

export default testData;
